import ModalImage from "react-modal-image";
import React from 'react';



class Modal extends React.Component{

    render(){
        const images = this.props.images
        return this.props.images.map(image => (
            <ModalImage
                small={require(image)}
                large={require(image)}
            />
        ));
    }
}

export default Modal;
